import React from "react";
import Pool from "../Pool/Pool";
import Songs from "../Songs/Songs";
import Swap from "../Swap/Swap";

export const Paths = [
  {
    title: "Swap",
    path: "/",
    component: <Swap />,
  },
  {
    title: "Xswap",
    path: "/songs",
    component: <Songs />,
  },
  {
    title: "Pool",
    path: "/pool",
    component: <Pool />,
  },
];
